let listOfAges = [12, 34, 28, 21, 44, 90, 18, 20, 25];

if ( listOfAges[0] >= 21) {
  console.log('Age at Index 0 is of age')
}

if ( listOfAges[1] >= 21) {
  console.log('Age at Index 1 is of age')
}

if ( listOfAges[2] >= 21) {
  console.log('Age at Index 2 is of age')
}

